<script>
  import footer1 from '@/components/publicPage/footer1'
  import {MessageBox} from 'mint-ui';
  export default {
    data(){
      return {
        explain: false,
        aa: false,
        arr: '',
        top: '',
        show: true,
        title: '',
        list: '',
        points: 0,
      }
    },
    created(){
      document.title = "签到"
      this.global.shouquan();
      this.noShare();
      //获取签到状态
      this.getData('get', '/shop-v1-user_get_member_sign_status.html').then(res => {
        if (res.status == 200) {
          for (let i = 0; i < res.data.length; i++) {
            if (res.data[i] == 5) {
              $('.money').eq(i).addClass('get').removeClass('noget');
              var day = new Date().getDay();
              if (day == 0) {
                if (i == 6) {
                  $('.getStatus').eq(0).addClass('nogeted').removeClass('geted');
                }
              } else {
                if (new Date().getDay() - 1 == i) {
                  $('.getStatus').eq(0).addClass('nogeted').removeClass('geted');
                }
              }
            }
          }
        }
      });
      this.postData('post', '/shop-v1-index_basemsg.html').then(res => {
        this.list = res.data
      });
      this.$route.query.fen ? this.points = this.$route.query.fen : '0';
    },
    mounted(){
      this.noShare();
      var day = new Date().getDay();
      if (day == 0) {
        day = 7;
      }
      for (let i = 0; i < day; i++) {
        $('.money').eq(i).addClass('noget')
      }
    },
    methods: {
      wen(){
        this.explain = true;
      },
      know(){
        this.explain = false;
      },
      qiandao(){
        //点击请求签到
        this.getData('get', '/shop-v1-user_memberSign.html').then(res => {
          if (res.status == 200) {
            if (res.data.status == 0) {
              MessageBox('提示', '您已经签到过了');
            } else if (res.data.status == 1) {
              MessageBox('提示', '签到成功！');
              this.points = Number(this.points) + Number(5);
              $('.getStatus').eq(0).addClass('nogeted').removeClass('geted');
              var day = new Date().getDay();
              if (day == 0) {
                day = 7;
              }
              $('.money').eq(day - 1).addClass('get').removeClass('noget')
            }
          }
        });

      }
    },
    components: {footer1},
  }
</script>

